INSERT INTO `projects` (`id`, `id_name`, `name`, `company_id`, `description`, `status`, `create_at`, `modified`, `priority`, `time_release`) VALUES
(1, 'AOE1', 'Game Aoe 1', 4, '<p><strong>M&ocirc; tả dự &aacute;n:</strong></p><p><em><strong>&nbsp; &nbsp; &nbsp; &nbsp;Age of Empires</strong></em>&nbsp;(tạm dịch:&nbsp;<em>Thời đại của những Đế chế</em>) (thường viết tắt l&agrave;&nbsp;<strong>AoE</strong>, ở&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam\">Việt Nam</a>&nbsp;quen gọi l&agrave;&nbsp;<strong>Đế Chế</strong>), l&agrave;&nbsp;<a href=\"https://vi.wikipedia.org/wiki/PC_game\">tr&ograve; chơi m&aacute;y t&iacute;nh</a>&nbsp;thuộc thể loại&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_l%C6%B0%E1%BB%A3c_th%E1%BB%9Di_gian_th%E1%BB%B1c\">chiến lược thời gian thực</a>&nbsp;<a href=\"https://vi.wikipedia.org/wiki/L%E1%BB%8Bch_s%E1%BB%AD\">lịch sử</a>&nbsp;trong vai tr&ograve; một người đứng đầu của một nền văn minh cổ xưa. Nền văn minh tiến triển qua bốn thời kỳ (<a href=\"https://vi.wikipedia.org/wiki/Th%E1%BB%9Di_ti%E1%BB%81n_s%E1%BB%AD\">Tiền sử</a>,&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Th%E1%BB%9Di_%C4%91%E1%BA%A1i_%C4%91%E1%BB%93_%C4%91%C3%A1\">Thời kỳ đồ đ&aacute;</a>,&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Th%E1%BB%9Di_%C4%91%E1%BA%A1i_%C4%91%E1%BB%93_%C4%91%E1%BB%93ng\">Thời kỳ đồ đồng</a>&nbsp;v&agrave;&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Th%E1%BB%9Di_%C4%91%E1%BA%A1i_%C4%91%E1%BB%93_s%E1%BA%AFt\">Thời kỳ đồ sắt</a>) do h&atilde;ng&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Ensemble_Studios\">Ensemble Studios</a>&nbsp;ph&aacute;t triển v&agrave;&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Microsoft\">Microsoft</a>&nbsp;ph&aacute;t h&agrave;nh v&agrave;o năm&nbsp;<a href=\"https://vi.wikipedia.org/wiki/1997\">1997</a>. Game sử dụng Genie, một&nbsp;<a href=\"https://vi.wikipedia.org/w/index.php?title=Engine&amp;action=edit&amp;redlink=1\">engine</a>&nbsp;với cơ cấu đồ họa&nbsp;<a href=\"https://vi.wikipedia.org/w/index.php?title=2D&amp;action=edit&amp;redlink=1\">2D</a>.<a href=\"https://vi.wikipedia.org/wiki/Age_of_Empires_(tr%C3%B2_ch%C6%A1i_%C4%91i%E1%BB%87n_t%E1%BB%AD)#cite_note-5\">[5]</a></p><p><strong>Quy tr&igrave;nh l&agrave;m nhiệm vụ:</strong></p><ul><li>Nhận việc, v&agrave; xử l&yacute; c&ocirc;ng việc.</li><li>B&aacute;o c&aacute;o c&ocirc;ng việc đầy đủ.</li><li>Cần kiểm thử phần mềm trước khi y&ecirc;u cầu kiểm tra.&nbsp;</li><li>Đưa l&ecirc;n git hub&nbsp;https://github.com/longnguyen28596/TaskManagement để quản&nbsp; l&yacute; code</li></ul>', 1, '2018-04-11 09:32:08', NULL, 'Thấp', NULL),
(2, 'QA', 'Web PHP bán quần áo', 2, '<p><strong>CHỨC NĂNG</strong></p><p><strong>Kh&aacute;ch h&agrave;ng</strong></p><ul><li>Đăng k&iacute;</li><li>Đăng nhập</li><li>Đổi mật khẩu</li><li>Cập nhật th&ocirc;ng tin</li><li>T&igrave;m kiếm sản phẩm</li><li>Xem chi tiết sản phẩm</li><li>Đặt h&agrave;ng</li><li>Thanh to&aacute;n</li></ul><p><strong>Quản trị website</strong></p><ul><li>Quản l&yacute; người d&ugrave;ng</li><li>Quản l&yacute; sản phẩm</li><li>Quản l&yacute; b&igrave;nh luận&nbsp;</li><li>Quản l&yacute; h&oacute;a đơn</li><li>Thống k&ecirc; b&aacute;o c&aacute;o</li></ul>', 1, '2018-04-11 09:32:08', NULL, 'Thấp', NULL),
(4, 'DATN', 'Đồ án - Nguyễn Hoàn Long', 5, '<p>M&ocirc; tả:&nbsp;</p><p>Đ&acirc;y l&agrave; đồ &aacute;n thực tập của sinh vi&ecirc;n Nguyễn Ho&agrave;n Long, thực tập tại c&ocirc;ng ty. Website quản l&yacute; c&ocirc;ng việc, đảm bảo c&aacute;c chức năng gửi mail, giao việc nhận việc,...</p><p>h&agrave;ng ng&agrave;y nh&acirc;n niệm vụ tại danh s&aacute;ch c&ocirc;ng việc của dự &aacute;n với m&atilde; dự &aacute;n l&agrave; DATN</p><p>Quản l&yacute; source tại trang&nbsp;https://github.com/longnguyen28596/TaskManagement</p>', 0, '2018-04-16 03:52:30', NULL, '1', NULL),
(1246, 'AOE2', 'Game Aoe 2', 4, '<p><strong>M&ocirc; tả dự &aacute;n:</strong></p><p><em><strong>&nbsp; &nbsp; &nbsp;Age of Empires II: The Age of Kings</strong></em>&nbsp;(thường được viết tắt l&agrave;&nbsp;<em><strong>AGE2</strong></em>,&nbsp;<em><strong>The Age of Kings</strong></em>,&nbsp;<em><strong>AoE II</strong></em>&nbsp;hoặc&nbsp;<em><strong>AOK</strong></em>) l&agrave; một&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Tr%C3%B2_ch%C6%A1i\">tr&ograve; chơi</a>&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_l%C6%B0%E1%BB%A3c_th%E1%BB%9Di_gian_th%E1%BB%B1c\">chiến lược thời gian thực</a>&nbsp;được&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Ensemble_Studios\">Ensemble Studios</a>&nbsp;ph&aacute;t triển v&agrave; tập đo&agrave;n&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Microsoft\">Microsoft</a>&nbsp;ph&aacute;t h&agrave;nh. Được ph&aacute;t h&agrave;nh lần đầu ti&ecirc;n v&agrave;o năm&nbsp;<a href=\"https://vi.wikipedia.org/wiki/1999\">1999</a>&nbsp;d&agrave;nh cho c&aacute;c&nbsp;<a href=\"https://vi.wikipedia.org/wiki/H%E1%BB%87_%C4%91i%E1%BB%81u_h%C3%A0nh\">hệ điều h&agrave;nh</a>&nbsp;Windows&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Microsoft\">Microsoft</a>&nbsp;v&agrave;&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Macintosh\">Macintosh</a>, n&oacute; l&agrave; tr&ograve; chơi thứ hai trong loạt tr&ograve; chơi&nbsp;<em><a href=\"https://vi.wikipedia.org/wiki/Age_of_Empires\">Age of Empires</a></em>. Bản mở rộng của n&oacute;,&nbsp;<em><a href=\"https://vi.wikipedia.org/wiki/Age_of_Empires_II:_The_Conquerors\">The Conquerors</a></em>&nbsp;được ph&aacute;t h&agrave;nh v&agrave;o năm&nbsp;<a href=\"https://vi.wikipedia.org/wiki/2000\">2000</a>. Một phi&ecirc;n bản&nbsp;<a href=\"https://vi.wikipedia.org/wiki/PlayStation_2\">PlayStation 2</a>&nbsp;được&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Konami\">Konami</a>&nbsp;ph&aacute;t h&agrave;nh v&agrave;o năm&nbsp;<a href=\"https://vi.wikipedia.org/wiki/2001\">2001</a>&nbsp;v&agrave; một phi&ecirc;n bản phụ tr&ecirc;n&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Nintendo_DS\">Nintendo DS</a>,&nbsp;<em><a href=\"https://vi.wikipedia.org/w/index.php?title=Age_of_Empires:_The_Age_of_Kings&amp;action=edit&amp;redlink=1\">Age of Empires: The Age of Kings</a></em>, được&nbsp;<a href=\"https://vi.wikipedia.org/w/index.php?title=Backbone_Entertainment&amp;action=edit&amp;redlink=1\">Backbone Entertainment</a>&nbsp;ph&aacute;t triển năm&nbsp;<a href=\"https://vi.wikipedia.org/wiki/2006\">2006</a>. Phi&ecirc;n bản cho&nbsp;<a href=\"https://vi.wikipedia.org/wiki/Dreamcast\">Dreamcast</a>&nbsp;của Konami đ&atilde; bị hủy bỏ.</p>', 0, '2018-05-29 16:54:27', NULL, 'Cao', '2020-08-31 23:52:00'),
(1247, 'HH', 'Website hẹn hò ', 2, '<p>M&ocirc; tả dự &aacute;n v&agrave; qu&aacute; tr&igrave;nh l&agrave;m việc:&nbsp;</p><ul><li>Đ&acirc;y l&agrave; 1 dự &aacute;n kiểu mantain, H&agrave;ng ng&agrave;y sẽ nhận task v&agrave; b&aacute;o c&aacute;o c&ocirc;ng việc thường xuyền cho nh&acirc;n vi&ecirc;n trưởng ph&ograve;ng.</li><li>Deploy cần phải mượn server trước.&nbsp;</li><li>Trang quản l&yacute; source code:&nbsp;https://github.com/longnguyen28596/TaskManagement</li></ul>', 0, '2018-05-29 17:02:46', NULL, '1', '1970-01-01 08:00:00');

